                            <tspan x="141.172" y="19">Cocoa Beans</tspan>
                            <tspan x="87.184" y="39" font-family="Optima-Regular, Optima" font-weight="normal">Following the richness of African </tspan>
                            <tspan x="102.346" y="53" font-family="Optima-Regular, Optima" font-weight="normal">chocolate, we use the most </tspan>
                            <tspan x="93.784" y="67" font-family="Optima-Regular, Optima" font-weight="normal">exotic and purest cocoa beans </tspan>
                            <tspan x="86.236" y="81" font-family="Optima-Regular, Optima" font-weight="normal">and present to you sinful flavours </tspan>
                            <tspan x="88.954" y="95" font-family="Optima-Regular, Optima" font-weight="normal">that you can totally escape into!</tspan>
                        </text>

                            <tspan x="139.474" y="20">Chocolate</tspan>
                            <tspan x="82.93" y="40" font-family="Optima-Regular, Optima" font-weight="normal">Crafted with renowned Belgian </tspan>

                        <text id="Strawberries-Inspire" font-family="Optima-Bold, Optima" font-size="12" font-weight="bold" line-spacing="23" letter-spacing="0.3" fill="#FFFFFF">
                            <tspan x="145.194" y="15">Strawberries</tspan>
                            <tspan x="98.796" y="35" font-family="Optima-Regular, Optima" font-weight="normal">Inspired by the snowy winters </tspan>
                            <tspan x="115.302" y="49" font-family="Optima-Regular, Optima" font-weight="normal">of Poland, the fresh and </tspan>
                            <tspan x="100.14" y="63" font-family="Optima-Regular, Optima" font-weight="normal">delicious strawberries we use </tspan>
                            <tspan x="103.62" y="77" font-family="Optima-Regular, Optima" font-weight="normal">are blended together to give </tspan>
                            <tspan x="99.396" y="91" font-family="Optima-Regular, Optima" font-weight="normal">you a palatable experience in </tspan>
                            <tspan x="153.264" y="105" font-family="Optima-Regular, Optima" font-weight="normal">each bite.</tspan>
                        </text>
